import "./ExpensesItem.css"

function ExpensesItem(){

    const expenseDate=new Date(2021,2,21);

    return (
    <div className="expense-item">
        <p>{expenseDate}</p>
        <p className="expense-item__description">Expense </p>
        <p className="expense-item__price">Amount</p>
    </div>

    );
}

export default ExpensesItem;
